    {
        Provider.WorldManagerDisplays.Add(new WorldBackupsDisplay());
        Provider.WorldManagerDisplays.Add(new WorldBackupPolicyDisplay());
    }

    public WorldManager()
    {
        SelectedView = Provider.WorldManagerDisplays.First();
    }

